import React from 'react'
import Head from 'next/head';
import ListingWrapper, {
    CheckVisaWrapper
  } from 'container/Listing/Listing.style';
  import { Card, Breadcrumb } from 'antd';

export default function CheckVisa() {
    return (
       <CheckVisaWrapper>
             <Head>
        <title>Blog chia sẻ kinh nghiệm thông tin và kế hoạch du lịch</title>
      </Head>
      <BreadcrumbWrapper>
        <Breadcrumb>
          <Breadcrumb.Item href="/">
            <span>Trang chủ</span>
          </Breadcrumb.Item>
          <Breadcrumb.Item href="/blog">
            <span>Blog</span>
          </Breadcrumb.Item>
        </Breadcrumb>
        <Divider />
      </BreadcrumbWrapper>
       </CheckVisaWrapper>
    )
}
